import { theLink } from "../assets/data/ScrapedArticles";
import { Container } from "./Hero";
import { useState, useEffect } from "react";

const PublishedWorks = () => {
  const { publication, handlePublication } = useState("none");

  return (
    <div>
      <Container style={{ borderRadius: "0" }}>
        {
          (publication = "link" ? (
            theLink.map((article) => {
              return <div>{article.header}</div>;
            })
          ) : (
            <></>
          ))
        }
      </Container>
    </div>
  );
};

export default PublishedWorks;
